import React from 'react';
import './grid_layout.css'
import LoginBox from './loginbox/loginbox.js'

class GridLayout extends React.Component
{
	constructor(props)
	{
		super(props);
		this.state = {
			var:0
		}
	}


	rendergrid_1()
	{
		return(
			<div className="grid1">
			/*Grid1*/
			</div>
		);
	}

	rendergrid_2()
	{
		return(
			<div className="grid2">
			Grid2
			</div>
		);
	}

	rendergrid_3()
	{
		return(
			<div className="grid3">
			Grid3
			</div>
		);
	}

	renderTopBar()
	{
		return(
			< div className="topbar" >
				{this.rendergrid_1()}
				{this.rendergrid_2()}
				{this.rendergrid_3()}
			</div>
		)
	}


	rendergrid_c1()
	{
		return(
			<div className="gridc1">
			Grid1
			</div>
		);
	}

	rendergrid_c2()
	{
		return(
			<div className="gridc2">
			{this.render_center_right()}
			</div>
		);
	}

	rendergrid_cr1()
	{
		return(
			<div className="gridcr1">
			c1
			</div>
		);
	}

	renderLoginContainer()
	{
		return(
			<LoginBox />
		);
	}


	rendergrid_cr_loginbox()
	{
		return(
			<div className="gridcrloginbox">
				{this.renderLoginContainer()}
			</div>
		);
	}

	render_center_right()
	{
		return(
			<div className="centerright">
				{/*this.rendergrid_cr1()*/}
				{/*this.rendergrid_cr1()*/}
				{/*this.rendergrid_cr1()*/}
				{/*this.rendergrid_cr1()*/}
				{this.rendergrid_cr_loginbox()}
			</div>
		);

	}

	renderCenterArea()
	{
		return(
			<div className="centerarea">
				{this.rendergrid_c1()}
				{this.rendergrid_c2()}
			</div>
		);
	}

	render()
	{
		return(
			<div>
				{this.renderTopBar()}
				{this.renderCenterArea()}
			</div>
		);
	}
}

export default GridLayout;
